import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { CssBaseline, Container, AppBar, Toolbar, Typography, Paper, Grid, makeStyles, createStyles, withStyles } from '@material-ui/core';

import Navbar from "./components/Navbar"

const useStyles = theme => ({
  root: {
    flexGrow: 1
  },
  tiles: {
    maxHeight: "1000px",
    height: "1000px",
    background: "radial-gradient(to right bottom, #430089, #82ffa1)",
  },
});

class App extends Component{
  constructor(){
    super();
    this.state = {
      response: false
    };
  }
  // className={classes.tiles}
  render(){
    const {classes} = this.props;
    return (
      <React.Fragment>
        <CssBaseline />
        <Container fixed className={classes.tiles}>
      <div>
        <Navbar />
      </div>
      </Container>
      </React.Fragment>
    )
  }
}

App.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(useStyles)(App);
